import React, {Component} from "react";


export default class UserInformation extends Component {
    render() {
       const userData=this.props.userData;
        return (
            <table className="table">
                <thead>
                <tr>
                    <th>winner</th>
                    <th>date</th>
                </tr>
                </thead>
                <tbody>
                {userData.map(p =>
                    <tr>
                        <td>{p.winner}</td>
                        <td>{p.date}</td>
                    </tr>
                )

                }
                </tbody>
            </table>
    )
    }
   }
